package warmke.mike.leet.p2135

import org.junit.jupiter.api.Test
import kotlin.test.assertEquals

internal class SolutionTest {

    val s = Solution()

    @Test
    fun test() {
        assertEquals(0, s.wordCount(arrayOf(), arrayOf()))
        assertEquals(0, s.wordCount(arrayOf(), arrayOf("hello")))
        assertEquals(1, s.wordCount(arrayOf("hel"), arrayOf("helo")))
        assertEquals(2, s.wordCount(arrayOf("ant","act","tack"), arrayOf("tack","act","acti")))
        assertEquals(1, s.wordCount(arrayOf("ab","a"), arrayOf("abc","abcd")))
        assertEquals(1, s.wordCount(arrayOf("mox","bj","rsy","jqsh"), arrayOf("trk","vjb","jkr")))
        assertEquals(1, s.wordCount(arrayOf("uh"), arrayOf("u","hur","k","b","u","yse","giqoy","lni","olqb","nemc")))
    }

